// src/router.js

import Vue from 'vue';
import Router from 'vue-router';
import Snake from './views/Snake.vue';

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/snake',
      component: Snake
    },
    // ... add other routes here
  ]
});
